INSERT INTO `wp_posts` VALUES (4,2,'2017-02-09 13:26:57','0000-00-00 00:00:00','Google has implemented geo-location to provide more local searches, so searching for a restaurant in San Francisco would give different results than searching for a restaurant in New York.\r\nGoogle has also implemented Secure Search (SSL Search) so that you won\'t be able to see the keywords that drove traffic to your site.\r\n\r\nSteps to take to perform an unbiased search:\r\n<ol>\r\n 	<li>Go to <a href=\"http://google.co.uk/\" target=\"_blank\">http://google.co.uk</a></li>\r\n 	<li>Make sure you’re not logged into your Google account.</li>\r\n 	<li>Search for your term and get the results.</li>\r\n 	<li>Go to the address bar in your web browser.</li>\r\n 	<li>Go all the way to the end of the Google result URL.</li>\r\n 	<li>Add this to the end of the string: <em><strong>&amp;gl=us&amp;pws=0</strong></em></li>\r\n 	<li>Hit enter.</li>\r\n</ol>\r\nThis gives you an unbiased search because:\r\n<ul>\r\n 	<li>You\'re using the UK version of google so you won\'t be hitting a regional google server</li>\r\n 	<li><strong>&amp;gl=us</strong> will be asking Google for its US results instead of google deciding fro you</li>\r\n 	<li><strong>&amp;pws=0 </strong>tells Google to send impersonal results.</li>\r\n</ul>','Performing Unbiased Searches','','draft','closed','closed','','','','','2017-02-09 13:26:57','2017-02-09 21:26:57','',0,'https://firstclick.wpengine.com/?page_id=4',0,'page','',0);
/*!40000 ALTER TABLE `wp_posts` ENABLE KEYS */;
UNLOCK TABLES;

